rc;ng việc nghi&ecirc;n cứu v&agrave; giảng dạy tại VnPro.</p>\r\n<p>Đội ngũ giảng vi&ecirc;n của VnPro l&agrave; những chuy&ecirc;n vi&ecirc;n cấp cao đầu ng&agrave;nh trong c&aacute;c c&ocirc;ng ty tập đo&agrave;n lớn tr&ecirc;n cả nước. Đ&atilde; c&oacute; 10 học vi&ecirc;n, giảng vi&ecirc;n v&agrave; nh&acirc;n vi&ecirc;n VnPro đạt chứng chỉ CCIE cao nhất của Cisco. VnPro tự h&agrave;o l&agrave; trung t&acirc;m c&oacute; nhiều học vi&ecirc;n đạt CCIE nhất tại Việt Nam.</p>\r\n<p><strong>Hoạt động giảng dạy v&agrave; hội thảo chuy&ecirc;n m&ocirc;n</strong></p>\r\n<p>&ndash; C&aacute;c buổi hội thảo chuy&ecirc;n đề được tổ chức với quy m&ocirc; lớn, quy tụ h&agrave;ng trăm học vi&ecirc;n c&ugrave;ng c&aacute;c kỹ sư mạng ở nhiều doanh nghiệp kh&aacute;c nhau.</p>\r\n<p>&ndash; Hội thảo tr&igrave;nh b&agrave;y c&aacute;c giải ph&aacute;p mới nhất c&ugrave;ng với những kỹ năng chuy&ecirc;n nghiệp m&agrave; một chuy&ecirc;n vi&ecirc;n mạng giỏi cần phải nắm bắt.</p>\r\n<p>&ndash; C&aacute;c th&agrave;nh vi&ecirc;n tham gia hội thảo được ch&agrave;o đ&oacute;n một c&aacute;ch chuy&ecirc;n nghiệp v&agrave; ho&agrave;n to&agrave;n miễn ph&iacute;.</p>\r\n<p>&ndash; Cơ hội được giao lưu với những chuy&ecirc;n gia mạng v&agrave; nhận những m&oacute;n qu&agrave; c&oacute; gi&aacute; trị.</p>\r\n<p>&ndash; Hoạt động giảng dạy tổ chức trong những lớp học theo ti&ecirc;u chuẩn quốc tế.</p>\r\n<p>&ndash; C&aacute;c giảng vi&ecirc;n thường xuy&ecirc;n thảo luận về c&aacute;c c&ocirc;ng nghệ ti&ecirc;n tiến nhất để &aacute;p dụng v&agrave;o b&agrave;i giảng.</p>\r\n<p>&ndash; C&aacute;c học vi&ecirc;n được truyền đạt theo phương ph&aacute;p khoa học được &aacute;p dụng nhiều tr&ecirc;n thế giới.</p>\r\n<p>&ndash; Học vi&ecirc;n c&oacute; khả năng tự thiết kế m&ocirc; h&igrave;nh.</p>\r\n<p>&ndash; Trực tiếp thao t&aacute;c tr&ecirc;n thiết bị.</p>\r\n<p>&ndash; &Aacute;p dụng những m&ocirc; h&igrave;nh thực tế đang được x&acirc;y dựng tại c&aacute;c doanh nghiệp lớn.</p>\r\n<p>&ndash; Nắm bắt được những c&ocirc;ng nghệ mới nhất.</p>\r\n<p><strong>Đội ngũ giảng vi&ecirc;n</strong></p>\r\n<p>&ndash; Hơn 70 giảng vi&ecirc;n hợp t&aacute;c đ&agrave;o tạo c&aacute;c kh&oacute;a học.<br />&ndash; Số lượng giảng vi&ecirc;n ở c&aacute;c chuy&ecirc;n ng&agrave;nh:<br />+&nbsp;<a title=\"CCNA\" href=\"https://vnpro.vn/tag/ccna/\">CCNA</a>: 70 giảng vi&ecirc;n<br />+&nbsp;<a title=\"CCNP\" href=\"https://vnpro.vn/tag/ccnp/\">CCNP</a>&nbsp;Service Provider: 15 giảng vi&ecirc;n<br />+&nbsp;<a title=\"CCNP\" href=\"https://vnpro.vn/tag/ccnp/\">CCNP</a>&nbsp;Security: 15 giảng vi&ecirc;n<br />+ CCDP: 10 giảng vi&ecirc;n<br />+&nbsp;<a title=\"CCNP\" href=\"https://vnpro.vn/tag/ccnp/\">CCNP</a>&nbsp;Voice: 10 giảng vi&ecirc;n<br />+ CCIE: 8 giảng vi&ecirc;n<br />&ndash; C&aacute;c giảng vi&ecirc;n l&agrave; những chuy&ecirc;n vi&ecirc;n cấp cao v&agrave; đầu ng&agrave;nh trong c&aacute;c c&ocirc;ng ty v&agrave; tập đo&agrave;n lớn tr&ecirc;n cả nước.<br />&ndash; Được trang bị kỹ năng sư phạm chuy&ecirc;n nghiệp.<br />&ndash; Trải qua nhiều kỳ s&aacute;t hạch để đạt ti&ecirc;u chuẩn giảng dạy tại VnPro.</p>\r\n<p><strong>Trang thiết bị, ph&ograve;ng học</strong></p>\r\n<p>&ndash; H&agrave;ng trăm thiết bị được phục vụ h&agrave;ng ng&agrave;y tại c&aacute;c lớp học.<br />&ndash; Thiết bị đa chủng loại với nhiều chức năng kh&aacute;c nhau.<br />&ndash; Được sử dụng rộng r&atilde;i trong c&aacute;c doanh nghiệp lớn.<br />&ndash; Đầu tư n&acirc;ng cấp thường xuy&ecirc;n.</p>\r\n<p>&nbsp;</p>',NULL,NULL,48,48,NULL,'2021-11-14 17:37:25','2021-11-21 08:18:07'),(31,7,31,10,'CD19TM2','CTY TNHH MTV Dịch vụ viễn thông Phương Nam (PNC)','028 7300 2222','Chưa có người hướng dẫn','Sẽ bổ sung ngay khi có thông tin','cty-tnhh-mtv-dich-vu-vien-thong-phuong-nam-pnc','https://phuongnamtelecom.vn/','0309130075','VP Q10: D4 D6 Thất Sơn phường 15 Q10',NULL,'<p style=\"text-align: left;\">Phương Nam Telecom (PNC)</p>\r\n<p style=\"text-align: left;\">Th&agrave;nh lập ng&agrave