i l&agrave; dịch vụ Headhunt. Eleven ngay từ l&uacute;c h&igrave;nh th&agrave;nh được đầu tư bởi một c&ocirc;ng ty khởi nghiệp mới của RE.A.PRA tại Singapore - đ&oacute; l&agrave; SPARK X LAB. Trước đ&oacute;, khởi nguồn h&igrave;nh th&agrave;nh v&agrave;o năm 2016. Eleven hoạt động với tiền th&acirc;n l&agrave; C&ocirc;ng ty TNHH JobTown. Đ&acirc;y l&agrave; c&ocirc;ng ty cung cấp dịch vụ tuyển dụng cho c&aacute;c c&ocirc;ng ty c&oacute; nhu cầu. Hiện tại th&igrave; c&ocirc;ng ty đang tập trung v&agrave;o mảng x&acirc;y dựng dịch vụ tuyển dụng headhunt IT.</span></p>\r\n<p><span style=\"font-weight: 400;\">Mặt kh&aacute;c, sau một thời gian d&agrave;i nghi&ecirc;n cứu thị trường, C&ocirc;ng ty Eleven đ&atilde; nhận thấy rằng, hiện nay ng&agrave;nh CNTT (Information Technology) đang được đầu tư&nbsp; ph&aacute;t triển rất nhiều v&agrave; c&oacute; dấu hiệu tăng nhanh trong tương lai. Ch&iacute;nh v&igrave; thế, C&ocirc;ng ty Eleven đ&atilde; cho ra đời một bộ phận chuy&ecirc;n tuyển dụng về lĩnh vực CNNT n&agrave;y, để nắm bắt cơ hội, đ&aacute;p ứng số lượng ứng vi&ecirc;n cần thiết cho c&aacute;c c&ocirc;ng ty IT trong tương lai.</span></p>\r\n<p><span style=\"font-weight: 400;\">V&agrave;o th&aacute;ng 3 năm 2018, Eleven đầu tư v&agrave;o Việt Nam với tư c&aacute;ch l&agrave; một c&ocirc;ng ty start-up. V&agrave; đang ph&aacute;t triển với thương hiệu tuyển dụng ch&iacute;nh l&agrave; JT1- IT Recruitment Agency (chuy&ecirc;n về tuyển dụng IT). C&ocirc;ng ty n&agrave;y thực hiện theo m&ocirc; h&igrave;nh headhunt - t&igrave;m kiếm ứng vi&ecirc;n đ&aacute;p ứng nhu cầu kh&aacute;ch h&agrave;ng trong ng&agrave;nh IT.</span></p>\r\n<p><span style=\"font-weight: 400;\">Mang tầm nh&igrave;n v&agrave; sứ mệnh trở th&agrave;nh một trong những c&ocirc;ng ty tuyển dụng nh&acirc;n sự chất lượng v&agrave; h&agrave;ng đầu tại Việt Nam. V&igrave; lẽ đ&oacute;, c&ocirc;ng ty vẫn đang tr&ecirc;n đường&nbsp; cố gắng ph&aacute;t triển ng&agrave;y, mở rộng quy m&ocirc;. V&agrave; ch