gement: ELK</li>\r\n<li>Cloud Computing</li>\r\n</ul>\r\n</li>\r\n</ul>\r\n<ul>\r\n<li><strong>Đ&agrave;o tạo VoIP</strong>:\r\n<ul>\r\n<li>VoIP Admin: x&acirc;y dựng v&agrave; triển khai tổng đ&agrave;i VOIP doanh nghiệp</li>\r\n<li>VoIP Advanced: triển khai, vận h&agrave;nh khai th&aacute;c hệ thống Cloud PBX &ndash; tổng đ&agrave;i ảo</li>\r\n<li>VoIP Dev: t&iacute;ch hợp VoIP v&agrave;o Web/CRM/ERP sử dụng c&ocirc;ng nghệ WebRTC</li>\r\n</ul>\r\n</li>\r\n</ul>\r\n<p><span class=\"s1\">TEL4VN mang đến cho Học vi&ecirc;n một m&ocirc;i trường học tập l&yacute; tưởng:</span></p>\r\n<p class=\"p1\"><span class=\"s1\">&ndash; Thiết bị đầy đủ v&agrave; hiện đại.</span></p>\r\n<p class=\"p1\"><span class=\"s1\">&ndash; Chương tr&igrave;nh cập nhật li&ecirc;n tục, bảo đảm cho học vi&ecirc;n lu&ocirc;n tiếp cận với những c&ocirc;ng nghệ mới nhất.</span></p>\r\n<p class=\"p1\"><span class=\"s1\">&ndash; Giảng vi&ecirc;n c&oacute; nhiều kinh nghiệm triển khai hệ thống.</span></p>\r\n<p class=\"p1\"><span class=\"s1\">&ndash; Nhận thực tập, hướng dẫn đồ &aacute;n tốt nghiệp miễn ph&iacute; cho c&aacute;c bạn sinh vi&ecirc;n.</span></p>\r\n<p class=\"p1\"><span class=\"s1\">&ndash; Hỗ trợ đầu ra th&ocirc;ng qua c&aacute;c doanh nghiệp CNTT, Viễn th&ocirc;ng v&agrave; VNPT</span></p>',NULL,NULL,393,393,NULL,'2021-11-17 15:51:38','2021-11-17 16:10:10'),(182,14,405,3,NULL,'CÔNG TY TNHH GIẢI PHÁP VIỄN THÔNG TEL4VN','02836220868','Nguyễn Quốc Huy','0906755226','cong-ty-tnhh-giai-phap-vien-thong-tel4vn','support@tel4vn.com',NULL,'82/2/9 Đinh Bộ Lĩnh phường 26 quận Bình Thạnh TP Hồ Chí Minh',NULL,NULL,NULL,NULL,405,405,NULL,'2021-11-17 15:51:50','2021-11-17 15:53:24'),(183,2,359,4,NULL,'Công Ty TNHH Công Nghệ Phúc Nam Sơn','0313594591','Nguyễn Huy Cường','0975730114','cong-ty-tnhh-cong-nghe-phuc-nam-son','http://www.phucnamson.com.vn/','0313594591','65/4/13 Đường số 2, Phường 16, Quận Gò Vấp',NULL,'<p>Được th&agrave;nh lập v&agrave;o năm 2015, C&ocirc;ng Ty TNHH C&ocirc;ng Nghệ Ph&u