ĐỨC Trường Cao đẳng C&ocirc;ng nghệ Thủ Đức c&oacute; lịch sử tr&ecirc;n 35 năm h&igrave;nh th&agrave;nh v&agrave; ph&aacute;t triển. Tiền th&acirc;n của trường l&agrave; Trung t&acirc;m Gi&aacute;o dục Kỹ thuật Tổng hợp v&agrave; Hướng nghiệp Thủ Đức, được th&agrave;nh lập năm 1984. Năm 2002, Trung t&acirc;m Gi&aacute;o dục Kỹ thuật Tổng hợp v&agrave; Hướng nghiệp Thủ Đức được n&acirc;ng cấp th&agrave;nh Trường Trung học Kỹ thuật v&agrave; nghiệp vụ Thủ Đức. Đến năm 2008, Trường Cao đẳng C&ocirc;ng nghệ Thủ Đức được th&agrave;nh lập tr&ecirc;n cơ sở Trường Trung học Kỹ thuật v&agrave; nghiệp vụ Thủ Đức theo quyết định số 6426/QĐ-BGD-ĐT của Bộ Gi&aacute;o dục v&agrave; Đ&agrave;o tạo, trực thuộc UBND TP. Hồ Ch&iacute; Minh, hoạt động theo điều lệ trường cao đẳng. Từ năm học 2017-2018, trường thực hiện tuyển sinh v&agrave; đ&agrave;o tạo theo Luật Gi&aacute;o dục nghề nghiệp. Với phương ch&acirc;m: &ldquo;Lu&ocirc;n đổi mới v&agrave; ph&aacute;t triển&rdquo;, Trường Cao đẳng C&ocirc;ng nghệ Thủ Đức của ng&agrave;y h&ocirc;m nay vẫn đang kh&ocirc;ng ngừng ph&aacute;t triển để trở th&agrave;nh trường cao đẳng chất lượng cao c&oacute; nhiều ng&agrave;nh nghề đ&agrave;o tạo đạt chuẩn khu vực v&agrave; quốc tế.&nbsp;</p>',NULL,NULL,372,372,NULL,'2021-11-18 09:08:25','2021-11-24 08:42:32'),(194,13,381,6,'CD19DH1','CÔNG TY TNHH TM DV Quảng cáo Hp','0933456763','Anh Mẫn','0933456763','cong-ty-tnhh-tm-dv-quang-cao-hp',NULL,NULL,'117 Dân Chủ, P.Bình Thọ, Tp.Thủ Đức, Tp.Hồ Chí Minh',NULL,NULL,NULL,NULL,381,381,NULL,'2021-11-18 09:10:45','2021-11-23 10:28:51'),(195,13,371,6,'CD19DH3','Công ty In Ấn Cánh Sen','0915958579','Cô Trịnh Thị Minh Thảo','0915958579','cong-ty-in-an-canh-sen',NULL,NULL,'136/18 Trần Quang Diệu, Phường 14, Q.3, Tp.HCM',NULL,NULL,NULL,NULL,371,371,NULL,'2021-11-18 09:41:33','2021-11-22 14:02:47'),(196,13,374,10,NULL,'Healthy Mind','0902 378 362','Đỗ Khánh Linh','0902 378 362','healthy-mind','healthymind.ptl@gmail.com',NULL,'Quanaj, Thành phố Hồ Chí Minh',NUL