Minh',NULL,'<div>C&ocirc;ng ty TNHH MTV DV Viễn Th&ocirc;ng Phương Nam được th&agrave;nh lập ng&agrave;y 01 th&aacute;ng 04 năm 2010. Hoạt động kinh doanh của doanh nghiệp theo giấy ph&eacute;p kinh doanh số 0309130075 do Sở kế hoạch v&agrave; đầu tư th&agrave;nh phố Hồ Ch&iacute; Minh cấp ng&agrave;y 01/03/2010.</div>\r\n<div>Năm 2003, FPT Telecom bắt đầu chuyển đổi c&ocirc;ng nghệ Internet từ Dial Up sang ADSL, vừa l&agrave;m vừa t&igrave;m hiểu, r&uacute;t kinh nghiệm. Tuyển dụng 20 nh&acirc;n vi&ecirc;n kỹ thuật đầu ti&ecirc;n từ trường Trung Cấp L&yacute; Tự Trọng. K&eacute;o những tuyến c&aacute;p đầu ti&ecirc;n cho c&aacute;c kh&aacute;ch h&agrave;ng ADSL.</div>\r\n<div>Năm 2004 &ndash; 2006, FPT Telecom thay đổi, ph&aacute;t triển li&ecirc;n tục cả về c&ocirc;ng nghệ v&agrave; quy m&ocirc; mở rộng ra khắp th&agrave;nh phố Hồ Ch&iacute; Minh, H&agrave; Nội v&agrave; to&agrave;n quốc. Nh&acirc;n sự ph&aacute;t triển li&ecirc;n tục cả về số lượng v&agrave; chất lượng, ho&agrave;n thiện dần quy tr&igrave;nh, th&agrave;nh lập c&aacute;c ph&ograve;ng ban, trung t&acirc;m kỹ thuật triển khai &ndash; bảo tr&igrave; dịch vụ Internet.</div>\r\n<div>Năm 2007, FPT Telecom outsource bộ phận triển khai &ndash; bảo tr&igrave; thu&ecirc; bao cho đối t&aacute;c, tiền th&acirc;n của PNC Telecom hiện tại. Với sự ra đời của 2 đối t&aacute;c đầu ti&ecirc;n Hưng Th&ocirc;ng v&agrave; Xa Gần. Trong đ&oacute; Xa Gần l&agrave; do anh Phan Thế Anh L&acirc;n &ndash; cựu quản l&yacute; kỹ thuật FPT Telecom th&agrave;nh lập.</div>\r\n<div>Năm 2008, bắt đầu triển khai c&ocirc;ng nghệ FTTH, c&aacute;c đối t&aacute;c kh&aacute;c lần lượt ra đời: Si&ecirc;u Tốc, H&agrave; Khu&ecirc;, Trương Nguyễn, Hợp Nhất, chia nhau hoạt động ở 29 tỉnh th&agrave;nh miền Trung v&agrave; miền Nam. Tất cả đều do c&aacute;c quản l&yacute; kỹ thuật FPT Telecom th&agrave;nh lập.</div>\r\n<div>Sau giai đoạn ph&aacute;t triển li&ecirc;n tục v&agrave; mạnh mẽ của c&aacute;c c&ocirc;ng ty đối t&aacute;c, FPT Telecom đ&atilde; đến l&uacute;c c&oacute; lượng kh&aacute;ch h&agrave;ng đủ lớn cần phải được quản l&yacute; theo một m&ocirc; h&igrave;nh thống nhất v&agrave; chuy&ecirc;n nghiệp hơn, đ&oacute; l&agrave; l&yacute; do th&agrave;nh lập n&ecirc;n c&ocirc;ng ty TNHH MTV DV Viễn Th&ocirc;ng Phương Nam &ndash; đối t&aacute;c độc quyền của FPT Telecom khu vực ph&iacute;a Nam dưới sự quản l&yacute; của Gi&aacute;m đốc &ndash; Phạm Mạnh Ho&agrave;ng, Trưởng Ph&ograve;ng Kỹ Thuật anh C&aacute;p Xu&acirc;n H&ograve;a.</div>',NULL,NULL,334,334,NULL,'2021-11-21 09:07:57','2021-11-21 09:17:10'),(238,2,335,4,'CD19TM1','Icare Center Thủ Đức','1900 6076','Phan Quốc Bảo','0904493015','icare-center-thu-duc','https://www.icare.center/',NULL,'113 Đặng Văn Bi, phường Trường Thọ, TP. Thủ Đức',NULL,'<p><strong><em>Care Center th&agrave;nh lập th&aacute;ng 07/2010, hoạt động trong lĩnh vực c&ocirc;ng nghệ th&ocirc;ng tin, hiện tại iCare Center c&oacute; 4 chi nh&aacute;nh tại T&acirc;n B&igrave;nh, Thủ Đức, Quận 5, Quận 12.</em></strong></p>\r\n<p><br />Gần 10 năm kinh nghiệm v&agrave; lu&ocirc;n xem kh&aacute;ch h&agrave;ng l&agrave; trọng t&acirc;m với phương ch&acirc;m &ldquo;<strong>Lu&ocirc;n giữ niềm tin nơi kh&aacute;ch h&agrave;ng</strong>&rdquo; iCare Center từ l&acirc;u được kh&aacute;ch h&agrave;ng biết đến l&agrave; đơn vị uy t&iacute;n sửa chữa m&aacute;y t&iacute;nh, điện thoại c&ugrave;ng c&aacute;c thiết bị c&ocirc;ng nghệ th&ocirc;ng tin.<br /><br />H&ograve;a c&ugrave;ng sự ph&aacute;t triển của c&ocirc;ng nghệ v&agrave; thay đổi trong th&oacute;i quen của người ti&ecirc;u d&ugrave;ng, v&agrave;i năm trở lại đ&acirc;y iCare Center ch&iacute;nh thức cung cấp th&ecirc;m c&aacute;c dịch vụ sửa chữa m&aacute;y t&iacute;nh, điện thoại tận nơi với nhiều tiện &iacute;ch. Đ&acirc;y được xem cột mốc quan trọng trong chiến lược mở rộng thị trường của iCare Center.</p>\r\n<p><strong>Sứ mệnh:</strong>&nbsp;Cung cấp c&aacute;c dịch vụ chất lượng với mong muốn gi&uacute;p thiết bị của kh&aa