\">\r\n<div class=\"text-center bold col-sm-6 col-md-20-percent talking-numbers\">\r\n<div class=\"box-bg-white\">\r\n<div class=\"container\">\r\n<div class=\"col-xs-12 margin-35 introduce text-justify\">\r\n<div class=\"col-xs-12 col-sm-8\">\r\n<p>Với sứ mệnh ti&ecirc;n phong mang Internet, mang kết nối đến với người d&acirc;n Việt Nam c&ugrave;ng mong muốn lớn lao mỗi gia đ&igrave;nh Việt Nam đều sử dụng &iacute;t nhất một dịch vụ của C&ocirc;ng ty, FPT Telecom đang nỗ lực thực thi Chiến lược &ldquo;Mang đến trải nghiệm tuyệt vời cho kh&aacute;ch h&agrave;ng&rdquo; tr&ecirc;n cơ sở ph&aacute;t huy gi&aacute; trị văn h&oacute;a cốt l&otilde;i &ldquo;Lấy kh&aacute;ch h&agrave;ng l&agrave;m trọng t&acirc;m&rdquo; v&agrave; nền tảng sức mạnh c&ocirc;ng nghệ FPT, từ đ&oacute; ti&ecirc;n phong trở th&agrave;nh Nh&agrave; cung cấp dịch vụ số c&oacute; trải nghiệm kh&aacute;ch h&agrave;ng vượt trội, tốt nhất tại Việt Nam.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>',NULL,NULL,348,348,NULL,'2021-11-21 11:28:51','2021-11-21 11:37:57'),(260,11,211,3,'19211TT3509','Công ty phần mềm điện toán đám mây Keri','028 3715 0068','Trần Thị Thanh','0868282755','cong-ty-phan-mem-dien-toan-dam-may-keri',NULL,NULL,'Lầu 1, Phòng 205, Tòa Nhà SBI, Lô 6B, Đường Số 3, Công Viên Phần Mềm Quang Trung, Phường Tân Chánh Hiệp, Quận 12, Thành phố Hồ Chí Minh',NULL,NULL,NULL,NULL,211,211,NULL,'2021-11-21 11:30:23','2021-11-21 11:30:23'),(261,8,72,5,'CD18TT8','Aziworld','+28.388.00.659','Lê Phước Hưng','0388324315','aziworld',NULL,NULL,'13 Đ. Lê Đại Hành, Phường 15, Quận 11, Thành phố Hồ Chí Minh',NULL,NULL,NULL,NULL,72,72,NULL,'2021-11-21 12:05:50','2021-11-21 12:05:50'),(262,10,189,3,'18211TT4926','CÔNG TY TNHH LOFIVN','079 6666 354','Nguyễn Hoàng Duy','0981041213','cong-ty-tnhh-lofivn','https://lofivn.com/','0316573800','403 Nguyễn Thái Bình, Phường 12, Tân Bình, TP. Hồ Chí Minh',NULL,'<p>Hiện nay LOFIVN đang triển khai mang đến những dịch vụ ch&iacute;nh cho cả nh&agrave; đ&o