INSERT INTO `internship_diary` VALUES (2,11,'19/07/2021','24/07/2021','- Công  việc được giao\r\n Tìm hiểu văn hóa công ty, làm bài test về văn hóa môi trường công ty.\r\n	\r\n- Nội dung - kết quả đạt được:\r\n Học hỏi được văn hóa làm việc của công ty. \r\n Nắm rõ hơn về sự hình thành của công ty và tác phong làm việc','- Công  việc được giao\r\nTham gia meeting và học cách viết daily report và take note meeting\r\n\r\nLàm quen với GIT và cách sử dụng Git flow\r\n- Nội dung - kết quả đạt được:\r\nĐược mentor hướng dẫn làm quen với git và cách dùng git  flow','- Công  việc được giao\r\nĐọc tài liệu IOS và hoàn thành bài tập được giao\r\n\r\n- Nội dung - kết quả đạt được:\r\nĐược giao bài tập thiết kế UI và code các chức năng','- Công  việc được giao\r\nHoàn thành bài tập về UI\r\n\r\n- Nội dung - kết quả đạt được:\r\nSửa bài tập được giao từ anh mentor và nghe góp ý chỉnh cách lập trình.','- Công  việc được giao\r\nTiếp tục đọc tài liệu IOS được giao về phần coding\r\n\r\n- Nội dung - kết quả đạt được:\r\nHỏi mentor những phần còn thắc mắc về mảng coding và hoàn thiện kĩ năng lập trình tốt hơn',NULL,NULL,NULL,224,224,NULL,'2021-11-14 10:42:27','2021-11-14 10:49:44'),(3,11,'26/07/2021','31/07/2021','- Công việc được giao:\r\nLàm quen với phần mềm máy ảo của công ty\r\n\r\n- Nội dung – kết quả đạt được\r\nNắm được các bước và cách thực hiện khi dùng phần mềm của công ty đảm bảo bảo mật','- Công việc được giao:\r\nThiết kế giao diện ứng dụng banking cho người dùng\r\n\r\n- Nội dung – kết quả đạt được\r\nHoàn thành xây dựng giao diện app banking cho người dùng','- Công việc được giao:\r\nCode chức năng login, hỗ trợ mentor làm các công việc được giao\r\n\r\n- Nội dung – kết quả đạt được\r\nHoàn thành công việc được giao và code xong chức năng','OFF','- Công việc được giao:\r\n Hỗ trợ anh chị trong team code chức năng màn hình chính, xem source code \r\n\r\n- Nội dung – kết quả đạt được\r\nHỏi mentor những souce code chưa hiểu và hoàn thành công việc được giao',NULL,NULL,NULL,224,224,NULL,'2021-11-14 10:53:02','2021-11-14 10:53:02'),(4,11,'02/08/2021','07/08/2021','- Công việc được giao:\r\nTham gia meeting về chủ đề Report skill và Hourenshou_IT Director\r\nCode chức năng chuyển khoản, thanh toán, xem số dư tài khoản\r\n\r\n- Nội dung – kết quả đạt được:\r\nHoàn thành take note meeting và kĩ năng làm việc.\r\nBắt đầu xây dựng chức năng thanh toán','- Công việc được giao:\r\nĐọc souce code về phần góp ý, Smart OTP mentor giao\r\n\r\n- Nội dung – kết quả đạt được:\r\nTiếp tục xây dựng chức năng thanh toán, được hướng dẫn từ mentor, hỏi đáp thắc mắc về source code','- Công việc được giao:\r\nTiếp tục đọc và học hiểu source code.\r\nTiếp tục code chức năng xem số dư\r\n\r\n- Nội dung – kết quả đạt được:\r\nTiếp tục xây dựng chức năng chuyển khoản. Hiểu được souce code','OFF','- Công việc được giao:\r\nTiếp tục xây dựng hoàn thành chức năng xem số dư.\r\nHoàn thành source code và kiểm tra lại các trường hợp.\r\n\r\n\r\n- Nội dung – kết quả đạt được:\r\nHoàn thành công việc được giao xây dựng được một số chức năng trong ứng dụng\r\nKiểm tra và chỉnh sửa lại source code, test lại cho các trường hợp.',NULL,NULL,NULL,224,224,NULL,'2021-11-14 10:55:47','2021-11-14 10:55:47'),(5,11,'09/08/2021','14/08/2021','- Công việc được giao:\r\nĐọc tài liệu IOSNotesForProfessionals và làm bài test tuần 4\r\n\r\n-Nội dung – kết quả đạt được:\r\nĐọc hiểu tài liệu và source code.\r\nBắt đầu làm bài test tuần 4','- Công việc được giao:\r\nTiếp tục làm bài test tuần 4 và tìm hiểu về GCD and Reading JSON\r\n\r\n-Nội dung – kết quả đạt được:\r\nHoàn thành bài test 50%. \r\nTự học tìm hiểu về GCD và JSON.','- Công việc được giao:\r\nHoàn thành bài test \r\nTiếp tục tìm hiểu về GCD và Reading JSON\r\n\r\n-Nội dung – kết quả đạt được:\r\nHoàn thành bài test 100% và nộp bài đúng hạn.','- Công việc được giao:\r\nSửa bài test và góp ý về quá trình thực tập\r\n\r\n-Nội dung – kết quả đạt được:\r\nĐược mentor sửa bài test và hướng dẫn những lỗi lập trình hay mắc phải.','- Công việc được giao:\r\nTrình bày những gì tìm hiểu được về GCD và Reading JSON\r\nViết take note về phần tự học GCD và reading JSON\r\n\r\n-Nội dung – kết quả đạt được:\r\nMentor sửa bài take note và góp ý.','- Công việc được giao:\r\nĐọc tài liệu IOSNotesForProfessionals và làm bài test tuần 4\r\n\r\n-Nội dung – kết quả đạt được:\r\nĐọc hiểu tài liệu và source code.\r\nBắt đầu làm bài test tuần 4',NULL,NULL,224,224,NULL,'2021-11-14 10:58:05','2021-11-14 10:58:05'),(6,11,'16/08/2021','21/08/2021','- Công việc được giao:\r\nChọn đề tài để làm project cuối kì thực tập.\r\nĐọc tài liệu  IOS_Architectures\r\n\r\n- Nội dung – kết quả đạt được:\r\nĐọc hiểu tài liệu và source code.\r\nTrình bày về đề tài project.','- Công việc được giao:\r\nMentor giao việc chỉnh sửa viết comment cho source code\r\n\r\n- Nội dung – kết quả đạt được:\r\nHoàn thành công việc 100%','- Công việc được giao:\r\nTham gia meeting  về chủ đề teamwork\r\nViết take note meeting \r\n\r\n\r\n- Nội dung – kết quả đạt được:\r\nTham gia đầy đủ\r\nHoàn thành take note meeting','OFF','OFF',NULL,NULL,NULL,224,224,NULL,'2021-11-14 11:00:23','2021-11-14 11:00:23'),(7,11,'23/08/2021','28/08/2021','- Công việc được giao:\r\nXây  dựng giao diện project ứng dụng bán hàng.\r\n\r\n- Nội dung – kết quả đạt được:\r\nHoàn thành xây dựng giao diện','- Công việc được giao:\r\nXây dựng Giao diện màn hình đăng nhập và đăng ký\r\nXây dựng màn hình trang chủ, tìm kiếm, phân trang\r\n\r\n- Nội dung – kết quả đạt được:\r\nHoàn thành xây dựng các chức năng 100%','- Công việc được giao:\r\nXây dựng giao diện sản phẩm, thanh toán, phân loại \r\n\r\n- Nội dung – kết quả đạt được:\r\nHoàn thành xây dựng giao diện 100%','- Công việc được giao:\r\nXây dựng chức năng thông tin khách hàng, chỉnh sửa thông tin khách hàng, giỏ hàng, cập nhật giỏ hàng\r\n\r\n- Nội dung – kết quả đạt được:\r\nHoàn thành tiến độ 50%. Kiểm tra lại các trường hợp.','- Công việc được giao:\r\nTiếp tục xây dựng chức năng thông tin khách hàng, chỉnh sửa t