ẫn còn khó khăn','Công việc được giao:\r\n- Làm dự án demo, Có các chức năng đăng nhập, đăng kí, đăng xuất.\r\ntừ FE gọi api gửi dữ liệu lên server BE , có các chức năng thêm sửa xóa account.\r\n- Làm giao diện login, register\r\n\r\n	\r\nNội dung – kết quả đạt được:\r\n- Đã làm xong giao diện Đăng nhập, Đăng kí','Công việc được giao:\r\n- Làm giao diện thông tin người dùng, Tạo plugin bên botble cms.\r\n	\r\nNội dung – kết quả đạt được:\r\n- Đã làm xong giao diện Thông tin người dùng\r\n- Đã tạo xong plugin Botble CMS',NULL,NULL,327,327,NULL,'2021-11-15 11:03:30','2021-11-15 11:03:30'),(121,84,'2/8/2021','8/8/2021','Công việc được giao:\r\n-Tìm hiểu về Postman.\r\n- BE : Tìm hiểu kĩ hơn về botble\r\n\r\n\r\nNội dung – kết quả đạt được:\r\n- Đã tìm hiểu được cơ bản về Postman.\r\n- Đã tìm hiểu được cách tạo các table để nhập các trường dữ liệu bên phía admin.\r\n- Đã biết tạo và viết các api.','Công việc được giao:\r\n- BE : Mã hóa password và Tạo token.\r\n\r\n\r\nNội dung – kết quả đạt được:\r\n- Đã mã hóa được password theo dạng md5. Và login thành công sẽ tạo ra token','Công việc được giao:\r\n- BE : Viết các api lấy dữ liệu cho phần Login và Register, Account.\r\n\r\n\r\nNội dung – kết quả đạt được:\r\n- Đã viết được các api cho phần đăng kí, Đăng nhập, Thông tin ngừoi dùng','Công việc được giao:\r\n- FE : Gọi được api từ BE.\r\n\r\n\r\nNội dung – kết quả đạt được:\r\n- Đã hoàn thành chức năng đăng kí, đăng nhập. Khi đăng nhập thành công thì tạo ra token.','Công việc được giao:\r\n- FE : Làm chức năng hiển thị thông tin của Người dùng. Kiểm tra token nếu chưa có thì trả về trang đăng nhập.\r\n- BE : Viết API lấy thông tin ngừoi dùng.\r\n\r\n\r\n\r\nNội dung – kết quả đạt được:\r\n- Đã hoàn thành, khi đăng nhập thành công sẽ chuyển đến trang thông tin người dùng. Và thông tin người dùng sẽ hiển thị lên các form.','Công việc được giao:\r\n-- BE : Viết api update thông tin người dùng, mật khẩu, lấy thông tin của người dùng\r\n\r\n\r\nNội dung – kết quả đạt được:\r\n- Đã viết được api update thông tin, sửa password và thông tin người dùng.',NULL,NULL,327,327,NULL,'2021-11-15 11:04:21','2021-11-15 11:06:51'),(122,84,'9/8/2021','15/8/2021','Công việc được giao:\r\n- FE :Cho phép người dùng sửa được thông tin, và password khi nhập vào từ bàn phím.\r\n-FE : Tạo thêm các validator\r\n\r\n\r\nNội dung – kết quả đạt được:\r\n- Đã hoàn thành, khi người dùng sửa thông tin và password, sẽ trả về trang đăng nhập, đăng nhập thành công thì thông tin mới sẽ hiển thị lên.','Công việc được giao:\r\n- BE : Viết api đăng xuất, api đăng nhập cho admin và api hiển thị thông tin các người dùng.\r\n\r\nNội dung – kết quả đạt được:\r\n- Đã viết được các api và test qua postman.','Công việc được giao:\r\n- FE : Tạo layout cho trang đăng nhập và hiển thị thông tin các người dùng trong phần admin.\r\n\r\nNội dung – kết quả đạt được:\r\n- Đã hoàn thành các layout.','Công việc được giao:\r\n- FE : Khi đăng nhập bằng tài khoản admin sẽ chuyển đến trang thông tin các người dùng, và hiển thị tất cả người dùng.\r\n- FE : Chức năng đăng xuất\r\n\r\n\r\nNội dung – kết quả đạt được:\r\n- Đã gọi được api và hoàn thành chức năng, khi đăng nhập bằng tài khoản admin thành công thì sẽ trả về các list người dùng, khi nhấn đăng xuất sẽ xóa token và trả về trang đăng nhập admin.','Công việc được giao:\r\n- BE : Viết API sửa, xóa thông tin ngừoi dùng trong phần admin.\r\n- FE : Tạo các nút xóa, sửa trong từng mục người dùng.\r\n- FE : Làm chức năng xóa sửa thông tin.\r\n\r\n\r\nNội dung – kết quả đạt được:\r\n- Đã hoàn thành các api, và các button.\r\n- Đã hoàn thành khi click vào button xóa, sửa thì sẽ xóa, sửa người dùng và cập nhật lên db và hiển thị lên giao diện.','Công việc được giao:\r\n- FE : Làm reponsive\r\n\r\nNội dung – kết quả đạt được:\r\n- Đã viết được các reponsive cho các thiết bị mobile và table',NULL,NULL,327,327,NULL,'2021-11-15 11:09:40','2021-11-15 11:09:40'),(123,84,'16/8/2021','22/8/2021','Công việc được giao:\r\n- BÁO CÁO ĐỒ ÁN QUẢN LÝ USER.\r\