u dropdown của Trang chủ.\r\n\r\nNội dung – kết quả đạt được:\r\n- Đã hoàn thành khi click vào sẽ hiển thị các danh mục nổi bật của bài viết.',NULL,NULL,327,327,NULL,'2021-11-15 11:12:38','2021-11-15 11:14:39'),(125,84,'29/8/2021','3/9/2021','Công việc được giao:	\r\n- Gọi api hoàn thành chức năng render bài viết nổi bật,    danh mục thường gặp hiển thị trên thanh header kiểu dropdown của Trang danh sách bài viết.\r\n\r\nNội dung – kết quả đạt được:\r\n- Đã gọi và render được thành viên nổi bật, các bài viết nổi bật.\r\n- Đã hoàn thành khi click vào sẽ hiển thị các danh mục nổi bật của bài viết.','Công việc được giao:	\r\n- Làm layout cho Trang chi tiết bài viết và reponsive.\r\n\r\n\r\nNội dung – kết quả đạt được:\r\n- Đã hoàn thành giao diện và reponsive','Công việc được giao:	\r\n- Gọi api hoàn thành chức năng render bài viết liên quan của Trang chi tiết bài viết, Bài viết liên quan, sao trung bình, lượt xem.\r\n\r\nNội dung – kết quả đạt được:\r\n- Đã hoàn Thành render chi tiết bài viết, bài viết liên quan, sao trung bình, lượt xem của bài viết, tác giả, ngày viết .','Công việc được giao:	\r\n- Làm chức năng đánh giá, bình luận, hiển thị lượt xem, sao đánh giá.\r\n\r\nNội dung – kết quả đạt được:\r\n- Đã hoàn thành, khi đánh giá xong, sẽ hiển thị thông tin đánh giá dưới phần bình luận kèm sao và avt người đánh giá.','Công việc được giao:	\r\n- Xử lý khi render hình ảnh, và liên kết các trang tương ứng.\r\n\r\nNội dung – kết quả đạt được:\r\n- Đã hoàn thành render và xử lý hình ảnh. Tạo các đường liên kết cho các trang khi click vào avt, bài viết, bài viết nổi bật, sẽ trả về các trang tương ứng.','Công việc được giao:	\r\n- BÁO CÁO ĐỒ ÁN WEDSITE BLOG\r\n\r\nNội dung – kết quả đạt được:\r\n- Buổi báo cáo đã hoàn thành tốt đẹp, trao đổi thêm về kiến thức và những điều cần khắc phục.',NULL,NULL,327,327,NULL,'2021-11-15 11:15:03','2021-11-15 11:18:26'),(127,87,'29/11/2021','04/12/2022','Nhận Công Việc\r\nTìm hiểu công cụ Figma\r\nKết quả:Tìm hiểu được cách hoạt động,