g của dịch nên hoãn cưới)\r\n                                   Thiết kế file thiệp cưới vuông hình cô dâu chú rể\r\nKết quả đạt được     : Hoàn thành.\r\n                                   Tìm hình ảnh cô dâu chú rể, tìm font\r\n                                   Phác thảo ý tưởng.  \r\nGhi Chú                    : Gửi khách duyệt.\r\n                                   Chờ in.\r\nNhận xét của người hướng dẫn :','Công việc được giao: Thiết kế file thiệp cưới vuông hình cô dâu chú rể\r\nKết quả đạt được     : Đang hoàn thành.          \r\nGhi Chú                    :  Sắp xếp lại bố cục, đổi font chữ.\r\nNhận xét của người hướng dẫn :','Công việc được giao: Thiết kế file thiệp cưới vuông hình cô dâu chú rể\r\nKết quả đạt được     : Hoàn thành.          \r\nGhi Chú                    : Gửi anh Vinh xem mẫu.\r\nNhận xét của người hướng dẫn :',NULL,NULL,120,120,NULL,'2021-11-15 12:01:53','2021-11-15 12:03:14'),(136,90,'13/12/2021','19/12/2021','Công việc được giao: Thiết kế 2 mẫu thiệp sinh nhật ( 1 mẫu cho bé trai, 1 mẫu cho bé gái)\r\nKết quả đạt được     : Phát thảo ý tưởng\r\n                                   Thiết kế bố cục, sắp xếp hình ảnh\r\nGhi Chú                    :  \r\nNhận xét của người hướng dẫn :','Công việc được giao: Thiết kế 2 mẫu thiệp sinh nhật \r\nKết quả đạt được     : Hoàn thành.\r\nGhi Chú                    :  Gửi file cho anh Vinh\r\nNhận xét của người hướng dẫn :','Nghỉ','Công việc được giao: Chỉnh sửa nội dung 1 số file thiệp cưới của khách\r\n                                   ( do ảnh hưởng của dịch nên hoãn cưới )\r\nKết quả đạt được     : Hoàn thành.\r\nGhi Chú                    :  Gửi khách chờ duyệt in.\r\nNhận xét của người hướng dẫn :','Công việc được giao: Thiết kế file thiệp cưới vuông hình cô dâu chú rể\r\nKết quả đạt được     : Đang hoàn thành.\r\nGhi Chú                    : Sắp xếp lại bố cục, đổi font chữ.\r\nNhận xét của người hướng dẫn :','Công việc được giao: Thiết kế file thiệp cưới vuông hình cô dâu chú rể\r\nKết quả đ