ao diện hiển thị thông tin người dùng\r\n- Đã làm xong giao diện Update thông tin người dùng',NULL,NULL,83,83,NULL,'2021-11-15 14:26:18','2021-11-15 14:26:18'),(154,99,'02/08/2021','08/08/2021','Công việc được giao\r\n- Tìm hiểu phần mềm Postman.\r\n- Tìm hiểu kĩ hơn về Source Code Botble CMS\r\n\r\nNội dung – kết quả đạt được\r\n- Cài đặt và tìm hiểu thành công được Posman, cách test API trên Posman\r\n- Thay đổi được cấu trúc giao diện của Plugin Member','Công việc được giao\r\n- Tìm hiểu về User Token\r\n- Xây dựng API đăng ký, đăng nhập	\r\n\r\nNội dung – kết quả đạt được\r\n- Tìm hiểu thành công User Token\r\n- Xây dựng thành công API đăng ký, đăng nhập','Công việc được giao\r\n- Xây dựng API update profile\r\n- Xây dựng API update password\r\n\r\nNội dung – kết quả đạt được\r\n- Xây dựng thành công API update profile\r\n- Xây dựng thành công API update password','Công việc được giao\r\n- Liên kết giao diện Front End với các API đã viết bên Back End\r\n\r\nNội dung – kết quả đạt được\r\n- Hoàn thành gọi API cho trang đăng ký\r\n- Hoàn thành gọi API cho trang đăng nhập, lưu thành công Token API trả về vào Cookie','Công việc được giao\r\n- Tiếp tục liên kết giao diện Front End với các API đã viết bên Back End\r\n\r\nNội dung – kết quả đạt được\r\n- Hoàn thành kiểm tra bảo mật trang xem và update Profile, nếu người dùng chưa đăng nhập mà vào thẳng trang Profile, Update Profile thì sẽ bị văng ra trang Login','Công việc được giao\r\n- Tiếp tục liên kết giao diện Front End với các API đã viết bên Back End\r\n\r\nNội dung – kết quả đạt được\r\n- Hoàn thành gọi API cho chức năng update profile\r\n- Hoàn thành gọi API cho chức năng update password',NULL,NULL,83,83,NULL,'2021-11-15 14:30:21','2021-11-15 14:30:21'),(155,95,'16/08/2021','21/08/2021','Thiết kế template kho giao diện cho trang web onilink','Thiết kế template kho giao diện cho trang web onilink','Thiết kế template kho giao diện cho trang web onilink','Thiết kế template kho giao diện cho trang web onilink','Th