 nhập mà vào thẳng trang xem danh sách User, Update Profile User thì sẽ bị văng ra trang Login của người người quản trị','Công việc được giao\r\n- Xây dựng API đăng xuất cho người dùng quản trị\r\n- Xây dựng API xoá người dùng (Dùng Laravel Passport)\r\n- Liên kết các API vừa viết với trang quản trị\r\n\r\nNội dung – kết quả đạt được\r\n- Xây dựng thành công API đăng xuất cho người dùng quản trị\r\n- Xây dựng thành công API xoá người dùng\r\n- Liên kết thành công các API vừa viết với trang quản trị','Công việc được giao\r\n- Thiết kế reponsive cho cả 2 Website\r\n\r\nNội dung – kết quả đạt được\r\n- Hoàn thành thiết kế reponsive cho các thiết bị mobile và table (ipad)',NULL,NULL,83,83,NULL,'2021-11-15 14:34:51','2021-11-15 14:34:51'),(158,95,'30/08/2021','04/09/2021','Viết chức năng sao chép link cho người dùng trong trang web onilink','Viết chức năng sao chép link cho người dùng trong trang web onilink','Viết chức năng sao chép link cho người dùng trong trang web onilink','Sửa giao diện kho giao diện trong trang onlink','Sửa giao diện kho giao diện trong trang onlink','Sửa giao diện kho giao diện trong trang onlink',NULL,NULL,65,65,NULL,'2021-11-15 14:35:37','2021-11-15 14:35:37'),(159,99,'16/08/2021','22/08/2021','Công việc được giao\r\n- Báo cáo dự án cho công ty, nghe mentor nhận xét và đưa ra lời khuyên\r\n\r\nNội dung – kết quả đạt được\r\n- Buổi báo cáo diễn ra và kết thúc thành công\r\n- Mentor đưa ra lời nhận xét và một số lời khuyên để sinh viên cãi thiện một số khuyết điểm\r\n- Đóng và bàn giao dự án cho công ty, Mentor sẽ họp với công ty để giao dự án khác cho sinh viên','Công việc được giao\r\n- Công ty transfer dự án mới: \r\n- Thiết kế website blog cho phép người xem đọc bài, đăng ký thành viên để tạo và quản lý bài viết của mình.\r\n- Thiết kế Website để quản lý các bài viết và người dùng của Website trên\r\n- Tìm hiểu Laravel Passport để dùng cho phần Back End website\r\n\r\nNội dung – kết quả đạt được\r\n- Buổi transfer diễn ra thành công\r\n- Em đã nắm các thông tin của dự án mới\r\n- Em được nhóm giao cho phần Back End, viết các API và xây dựng Website quản trị\r\n- Tìm hiểu được một phần của Laravel Passport, có thể áp dụng vào \r\ndự án','Công việc được giao\r\n- Xây dựng API lấy thông tin profile của 1 User cụ thể\r\n\r\nNội dung – kết quả đạt được\r\n- Đã hoàn thành xong API lấy thông tin profile của 1 User cụ thể','Công việc được giao\r\n- Xây dựng API lấy danh sách 5 User có số lượng bài viết cao nhất\r\n\r\nNội dung – kết quả đạt được\r\n- Đã hoàn thành xong API lấy danh sách 5 User có số lượng bài viết cao nhất','Công việc được giao\r\n- Xây dựng API lấy danh sách 10 bài viết có số lượt view cao nhất\r\n- Xây dựng API lấy danh sách các danh mục nằm trong 10 bài viết nổi bật\r\n\r\nNội dung – kết quả đạt được\r\n- Đã hoàn thành xong API lấy danh sách 10 bài viết có số lượt view cao nhất\r\n- Đã hoàn thành xong API lấy danh sách các danh mục nằm trong 10 bài viết nổi bật','Công việc được giao\r\n- Xây dựng API lấy danh sách các bài viết thuộc 1 danh mục cụ thể (Có kèm chức năng phân trang, 10 bài viết / trang)\r\n\r\nNội dung – kết quả đạt được\r\n- Đã hoàn thành xong API lấy danh sách của các bài viết thuộc 1 danh mục',NULL,NULL,83,83,NULL,'2021-11-15 14:37:21','2021-11-15 14:37:21'),(160,99,'23/08/2021','29/08/2021','Công việc được giao\r\n- Xây dựng API lấy danh sách 5 bài viết có số lượt view cao nhất\r\n- Xây dựng API lấy danh sách tất cả bài viết, sắp xếp từ mới đến cũ (Có kèm chức năng phân trang, 10 bài viết / trang)\r\n\r\n- Thiết kế Website quản lý khu vực quản lý danh sách User\r\n- Xây dựng các chức năng cần thiết cho khu vực danh sách User, bao gồm : \r\n + Hiển thị list user của trang\r\n + Hỗ trợ phân trang, tối đa 10 user 1 trang \r\n  + Khi click vào một user thì xem thông tin chi tiết của user đó \r\n + Có thể deactive tài khoản của user, user khi bị deactive thì không thể đăng bài \r\n+ Filter tìm kiếm user theo tên, email\r\n\r\nNội dung – kết quả đạt được\r\n- Đã hoàn thành xong A