ẫu name card.\r\n- Hoàn thành công việc được giao.','- Gửi mẫu thiết kế cho khách.\r\n- Chỉnh sửa theo yêu cầu.\r\n- Hoàn thành thiết kế \r\n- Xuất và in cho khách hàng\r\n- Hoàn thành công việc được giao.','- Kiểm tra zalo, tiếp nhận thông tin phản hồi.\r\n- Sửa thiết kế theo mẫu có sẵn của khách.\r\n- Hoàn thành và xuất in cho khách.',NULL,NULL,264,264,NULL,'2021-11-15 19:17:39','2021-11-15 19:17:39'),(213,51,'09/08/2021','14/08/2021','- Kiểm tra zalo và mail thường xuyên nhận đơn thiết kế của khách hàng yêu cầu.\r\n- Chốt thiết kế cho khách.\r\n- Hoàn thành công việc được giao','- Thiết kế tem nhãn bánh kẹo theo ý của khách\r\n- Lên ý tưởng và phát thảo ít nhất 5 mẫu.\r\n- Hoàn thành công việc được giao..','- Gửi mẫu phát thảo cho khách.\r\n- Chỉnh sửa theo yêu cầu của khách hàng.\r\n- Hoàn thành công việc được giao.','- Gửi mẫu chỉnh sửa tem nhãn cho khách.\r\n- Tiếp tục chỉnh sửa đến khi đạt yêu cầu.\r\n- Xuất và in cho khách hàng.\r\n- Hoàn thành công việc được giao.','- Lên ý tưởng thiết kế túi giấy cho công ty.\r\n- Tìm hiểu các mẫu túi giấy phù hợp với tình hình dịch bệnh.\r\n- Hoàn thành công việc được giao.','- Phát thảo ít nhất 5 mẫu túi giấy và gửi cho trưởng phòng \r\n- Hoàn thành công việc được giao.',NULL,NULL,264,264,NULL,'2021-11-15 19:20:17','2021-11-15 19:20:17'),(214,51,'16/08/2021','21/08/2021','- Gửi mẫu thiết kế túi giấy cho trưởng phòng.\r\n- Chỉnh sửa các chi tiết mẫu túi\r\n- Hoàn thành công việc được giao','- Chỉnh sửa mẫu thiết kế túi giấy\r\n- Xuất file in gửi cho bộ phận in.\r\n- Hoàn thành công việc được giao..','- Thiết kế catologue 25 trang cho công ty nội thất.\r\n- Lên ý tưởng phát thảo bố cục.\r\n- Hoàn thành công việc được giao.','- Phát thảo bố cục cho trang bìa và 10 trang đầu thiết kế nội thất.\r\n- Hoàn thành công việc được giao.','- Tiếp tục phát thảo cho 15 trang còn lại thiết kế nội thất\r\n- Hoàn thành công việc được giao.','- Chỉnh sửa bố cục các trang thiết kế cho đồng nhất.\r\n- Hoàn thành công việc được giao.',NULL,NULL,264,264,NULL,'2021-11-15 19:22:39','2021-11-15 19:22:39'),(215,51,'23/08/2021','28/08/2021','- Thêm hình ảnh và nội dung khách cung cấp vào bố cục catologue\r\n- Hoàn thành công việc được giao','- Chỉnh sửa lại các bố cục catologue không hợp lý khi thêm hình ảnh vào.\r\n- Hoàn thành công việc được giao..','- Sửa màu và các mảng thiết kế phù hợp với nội thất.\r\n- Gửi cho khách xem và sửa theo yêu cầu\r\n- Hoàn thành công việc được giao.','- Tiếp tục sửa màu và các mảng thiết kế.\r\n- Dàn trang và xuất file gửi khách.\r\n- Hoàn thành công việc được giao.','- Kiểm tra zalo và mail thường xuyên nhận đơn thiết kế của khách hàng yêu cầu.\r\n- Tư vấn các mẫu thiết kế cho khách.\r\n- Hoàn thành công việc được giao.','- Nghiên cứu các phong cách thiết kế độc lạ cho các mẫu poster thu hút khách hàng.\r\n- Hoàn thành công việc được giao.',NULL,NULL,264,264,NULL,'2021-11-15 19:25:39','2021-11-15 19:25:39'),(216,51,'30/08/2021','04/09/2021','- Kiểm tra zalo và mail thường xuyên nhận đơn thiết kế của khách hàng yêu cầu.\r\n- Chốt thiết kế cho khách.\r\n- Hoàn thành công việc được giao','- Thiết kế lịch tết năm 2022 cho công ty.\r\n- Lên ý tưởng thiết kế và phát thảo mẫu.\r\n- Tìm hiểu tham khảo các mẫu lịch\r\n- Hoàn thành công việc được giao.','- Phát thảo 3 mẫu bìa lịch và bố cục lịch chung cho 12 tháng.\r\n- Gửi mẫu cho trưởng phòng duyệt.\r\n- Hoàn thành công việc được giao.','- Nghỉ lễ 2/9','- Chỉnh sửa bìa lịch tết 2022\r\n- Hoàn thành công việc được giao.','- Chỉnh sửa màu sắc và cân đối cục bìa lịch cho hợp lý.\r\n- Gửi bìa lịch đã chỉnh sửa hoàn thiện cho trưởng phòng.\r\n- Hoàn thành công việc được giao.',NULL,NULL,264,264,NULL,'2021-11-15 19:31:42','2021-11-15 19:31:42'),(217,51,'06/09/2021','11/09/2021','- Lên thiết kế tháng 1 của lịch\r\n- Gửi cho Trưởng Phòng duyệt.\r\n- Hoàn thành công việc được giao','- Chỉnh sửa font và định dạng các bội số của tháng 1.\r\n- Chỉnh sửa màu sắc tháng 1\r\n- Gửi cho Trưởng Phòng duyệt.\r\n- Hoàn thành công việc được giao.','- L