 nhãn dán chưa có điểm nhấn \r\nName card chưa hoàn chỉnh,thiết kế còn nhiều lỗi, sửa lại','Thiết kế nhãn dán an tuệ\r\nThiết kế name card lia\r\nNhận xét: Nhãn dán có điểm nhấn nhưng còn chưa được hoàn chỉnh . sử dụng hình ảnh logo chưa hợp với mục đích của nhãn dán \r\nName card còn nhiều điểm sai sót. Sửa lại','Thiết kế nhãn dán an tuệ \r\nThiết kế name care lia \r\nNhận xét: Làm thêm những option khác về nhãn dãn , làm nhiều bài khác nhau \r\nKhông sửa lại option cũ mà làm option mới hoàn toàn nhãn dán và name card.','Thiết kế nhãn dán an tuệ \r\nThiết kế name care lia \r\nNhận xét: Sửa lại những điểm, lỗi sai trong bài mà cô đã chỉ . \r\nMàu sắc chưa hợp với name card , thiết kế lại và sử dụng những màu sắc hợp hơn','Thiết kế nhãn dán an tuệ \r\nThiết kế name care lia \r\nNhận xét: Làm thêm option mới của nhãn dán và name card .\r\nCòn lỗi sai ở name card hình ảnh chưa phù hợp  , bố cục còn nhiều điểm trống  .sửa lại','Thiết kế nhãn dán an tuệ \r\nThiết kế name care lia \r\nNhận xét: Nộp lại 2 bài nhãn dán và name card cho cô  sau khi đã sửa lại và thay đổi nhiều option  khác nhau',NULL,NULL,386,386,NULL,'2021-11-17 13:46:52','2021-11-17 13:46:52'),(318,162,'16/8/2021','22/8/2021','Làm lại mẫu logo\r\nlàm mẫu hộp kích thước: 100x135x65mm\r\nOnl zoom cô hướng dẫn vẽ \r\nNhận xét: Chưa giống với sản phẩm đã đưa ra(sửa lại)\r\nMẫu hộp thiết kế chưa đúng kích thước cô đưa.(sửa lại)','Sửa lại 2 mẫu thiết kế logo và hộp \r\nNhận xét: Nộp logo đã sửa lại \r\nNộp thiết kế hộp cô đã giao (thiết kế đúng với kích thước cô giao )','Vẽ lại logo và dàn vào thiết kế hộp mà cô đã giao \r\nNhận xét: Nộp bài cô đã giao (chưa hoàn chỉnh vì vẫn con sai trong thiết kế lại logo , chưa đúng font chữ, nét chữ )','Vẽ lại logo giống mẫu\r\nThiết kế hộp bao bì  kích thước: 100x135x65mm\r\nNhận xét: Nộp 2 bài cho cô sau khi đã sửa lại hoàn chỉnh (sẩn phẩm logo là vẽ lại nên phải giống với mẫu đã đưa ra )','Thiết kế nhãn dán hạt maca \r\nkích thước nhãn: 80x100 mm\r\nNhận xét: Nộp bài nhãn