ng việc được giao: Thiết kế quán cafe 3D, kích thước mặt bằng 10x22m\r\n- Nội dung – kết quả đạt được: Tất cả bài đều đc duyệt, kết thúc đề án thiết kế quán cà phê 3d','- Công việc được giao: Thiết kế poster cho thương hiệu sản phẩm chăm sóc tóc Thủ Đạo Thang (4 poster)\r\n- Nội dung – kết quả đạt được:\r\n+ Người hướng dẫn giao việc, giải thích các vấn đề liên quan đến poster cần làm và ý nghĩa của poster\r\n+ Lên mạng tìm hiểu rõ về thương hiệu Thủ Đạo Thang, bao gồm các sản phẩm, công dụng của từng sản phẩm\r\n+ Bài bao gồm 1 poster tổng thể (bao gồm cả 3 sản phẩm) và 3 poster riêng cho từng sản phẩm','- Công việc được giao: Thiết kế poster cho thương hiệu sản phẩm chăm sóc tóc Thủ Đạo Thang (4 poster)\r\n- Nội dung – kết quả đạt được:\r\n+ Lên mạng tìm hình ảnh của sản phẩm, rồi tách sản phẩm ra khỏi nền bằng photoshop\r\n+ Lên ý tưởng cho 4 poster','- Công việc được giao: Thiết kế poster cho thương hiệu sản phẩm chăm sóc tóc Thủ Đạo Thang (4 poster)\r\n- Nội dung – kết quả đạt được:\r\n+ Tiến hành làm poster đầu tiên (dầu gội thảo dược Thủ Đao Thang)\r\n+ Phác thảo bố cục ra giấy\r\n+ Tạo khuôn viền xung quang nội dung poster, làm nổi bật sản phẩm bằng hình khối, nhập đầy đủ nội dung của sản phẩm\r\n+ Hoàn thành poster đầu tiên',NULL,NULL,378,378,NULL,'2021-11-18 19:54:25','2021-11-18 19:54:25'),(449,199,'30/08/2021','30/08/2021','- Công việc được giao: Thiết kế poster cho thương hiệu sản phẩm chăm sóc tóc Thủ Đạo Thang (4 poster)\r\n- Nội dung – kết quả đạt được:\r\n+ Tiến hành làm poster thứ 2 (dung dịch thanh lọc da đầu Thủ Đạo Thang)\r\n+ Phát thảo bố cục ra giấy\r\n+ Sử dụng các mảng màu để làm background, sử dụng mảng màu để làm nổi bật sản phẩm\r\n+ Nhập đầy đủ nội dung của sản phẩm\r\n+ Sử dụng các đưởng nét để làm nổi bật các nội dung như: Công dụng, thành phần, cách sử dụng,…\r\n+ Hoàn thành poster thứ 2','- Công việc được giao: Thiết kế poster cho thương hiệu sản phẩm chăm sóc tóc Thủ Đạo Thang (4 poster)\r\n- Nội dung – kết quả đạt được:\r\n+ Tiến hành làm poster thứ 3 (tinh chất phục hồi tơ tằm Thủ Đạo Thang)\r\n+ Phác thảo bố cục ra giấy\r\n+ Tạo background màu\r\n+ Sử dụng mảng màu làm nổi bật sản phẩm, sử dụng khung để bao quát nội dung của sản phẩm\r\n+ Nhập đầy đủ nội dung của sẩn phẩm\r\n+ Hoàn thành poster thứ 3','- Công việc được giao: Thiết kế poster cho thương hiệu sản phẩm chăm sóc tóc Thủ Đạo Thang (4 poster)\r\n- Nội dung – kết quả đạt được:\r\n+ Tiến hành làm poster tổng thể (gồm 3 sản phẩm)\r\n+ Phác thảo bố cục ra giấy\r\n+ Tạo background bằng nét màu\r\n+ Sử dụng mảng màu để làm nổi bật nội dung, sử dụng đường elip đứt để bao gồm các sản phẩm bên trong\r\n+ Nhập đầy đủ nội dung\r\n+ Hoàn thành poster tổng thể\r\n+ Xuất tất cả poster dưới dạng pdf và hình ảnh để nộp cho người hướng dẫn','- Công việc được giao: Thiết kế poster cho thương hiệu sản phẩm chăm sóc tóc Thủ Đạo Thang (4 poster)\r\n- Nội dung – kết quả đạt được: Người hướng dẫn nhận xét và đưa ra những điểm cần chỉnh sửa\r\n- Nhận xét: Poster 1,2 bố cục, màu sắc ổn ko cần chỉnh sửa, poster 3 cần đơn giản lại chỗ giá tiền, poster tổng thể còn hơn đơn điệu cần chỉnh sửa ở phần tiêu đề và giá cả\r\n- Yêu cầu: chỉnh sửa lại poster 3, poster tổng thể, hạn chót là thứ 4 tuần sau','- Công việc được giao: Thiết kế poster cho thương hiệu sản phẩm chăm sóc tóc Thủ Đạo Thang (4 poster)\r\n- Nội dung – kết quả đạt được: \r\n+ Chỉnh sửa poster 3\r\n+ Bỏ đường nét phía dưới “giá chỉ”, thay bằng 1 mảng màu để làm nổi bật nội dung\r\n+ Hoàn thành chỉnh sửa poster 3','- Công việc được giao: Thiết kế poster cho thương hiệu sản phẩm chăm sóc tóc Thủ Đạo Thang (4 poster)\r\n- Nội dung – kết quả đạt được: \r\n+ Chỉnh sửa poster tổng thể\r\n+ Bỏ đường line dưới giá tiền và thay bằng hình tròn\r\n+ Đổ bóng các sản phẩm để làm sinh động hơn\r\n+ Thay đổi font chữ để nhìn mềm mại hơn\r\n+ Hoàn thành chỉnh sửa poster tổng thể',NULL,NULL,378,378,NULL,'2021-11-18 20:00:45','2021-11-18 20:00:45'),(450,199,'06/09/2021','11/09/2021','- Công việc được giao: Thiết kế