ra :logo –font chữ -nét chữ cho đúng.\r\nVì bài làm lại theo mẫu nên cần đúng chính xác ,vì logo khách đã có chớ không phải thiết kế lại.','Cô không gia bài','Công việc được giao:\r\n1.	Làm lại mẫu card madacamia \r\n\r\nNội dung – kết quả đạt được:\r\nVẽ lại được mẫu nộp cô.\r\n\r\nNhận xét - đề nghị của người hướng dẫn tại doanh nghiệp:\r\nXem lại màu sắc , hình hạt macca không được sắc nét,kiểm tra font chữ.\r\nMàu sắc trong mẫu khách đưa không đúng ,mình sẽ làm lại và chỉnh màu sao cho tương đối trước khi gửi .Sau đó nếu có phản hồi mình xẽ chỉnh lại thêm.\r\nMình chủ động tự xử lý để mẫu đạt.',NULL,NULL,363,363,NULL,'2021-11-19 19:56:31','2021-11-23 11:01:29'),(497,188,'13/12/2021','19/12/2021','Cô không giao bài','Cô không giao bài','Cô không giao bài','Cô không giao bài','Cô không giao bài','Công việc được giao:\r\n1 làm poster theo yêu cầu \r\nSINH NHẬT LẦN THỨ 10 EMERAUDE SPA \r\n\r\nNội dung – kết quả đạt được:\r\nlàm được một mẫu của poster.\r\n\r\nNhận xét - đề nghị của người hướng dẫn tại doanh nghiệp:\r\nCô chưa nhận xét.',NULL,NULL,363,363,NULL,'2021-11-19 20:00:04','2021-11-23 11:02:09'),(498,188,'20/12/2021','26/12/2021','Cô không giao bài','Cô không giao bài','Cô không giao bài','Cô không giao bài','Công việc được giao:\r\n1.	Thiết kế BÀI SPA EMERAUDE - CÁC BẠN THIẾT KẾ THÊM  1 VOUCHER KÍCH THƯỚC: 180x65mm.\r\n2.	Vẽ lại mẫu hai bài .\r\n\r\nNội dung – kết quả đạt được:\r\nHoàn thành hai mặt voucher.\r\nChưa hoàn thành các bài còn lại.\r\n\r\nNhận xét - đề nghị của người hướng dẫn tại doanh nghiệp:\r\nCô kêu tiếp tục làm các bài trong tuần.','Công việc được giao:\r\n1.	Thiết kế BÀI SPA EMERAUDE - CÁC BẠN THIẾT KẾ THÊM  1 VOUCHER KÍCH THƯỚC: 180x65mm.\r\n2.	Vẽ lại mẫu hai bài .\r\n\r\nNội dung – kết quả đạt được:\r\nTiếp tục hoàn thành các bài được giao\r\n\r\nNhận xét - đề nghị của người hướng dẫn tại doanh nghiệp:\r\nCô kêu tiếp tục làm các bài trong tuần.',NULL,NULL,363,363,NULL,'2021-11-19 20:05:17','2021-11-23 11:02:38'),(499,188,'27/12/2021','2