ế nhãn Dầu thuốc tiên và hướng dẫn sử dụng\r\n\r\nNội dung – kết quả đạt được:\r\nĐang hoàn thành các bài.','Công việc được giao:\r\n1.Thiết kế name card nhà hàng nàng gánh\r\n2. Thiết kế  post card – cảm ơn cho nhà hàng\r\n3. Thiết kế nhãn Dầu thuốc tiên và hướng dẫn sử dụng\r\n\r\nNội dung – kết quả đạt được:\r\nThiết kế được postercard\r\nThiết kế được card nàng gánh\r\nThiết kế được bìa thư nàng gánh\r\nCòn bài ba đang làm\r\n\r\nNhận xét - đề nghị của người hướng dẫn tại doanh nghiệp:\r\npost card chưa rõ nội dung nha em - và em chọn hình nào nó phù hợp hơn - vì cái này là postcard em tìm hiểu thêm\r\nvà thường post card sẽ có 2 mặt\r\nName card món ăn em thêm option sáng hơn và rõ hơn thử nha.\r\nBao thư là dàn trên khuôn bế 2D - sau đó em dựng 3D như thế này cho khách dễ xem nha.',NULL,NULL,363,363,NULL,'2021-11-19 20:43:55','2021-11-23 11:05:04'),(504,45,'26/07/2021','31/07/2021','- Công việc được giao:\r\n     Thiết kế quán cà phê 3D, kích thước mặt bằng 10x22m\r\n\r\n- Nội dung và kết quả đạt được:\r\nTham khảo, tìm hiểu các thông tin trên internet về các nguyên tắc, những lưu ý kkhi thiết kế mặt bằng, quán cà phê.','- Công việc được giao:\r\nThiết kế quán cà phê 3D, kích thước mặt bằng 10x22m\r\n\r\n- Nội dung và kết quả đạt được:\r\n Lên ý tưởng cho quán cà phê:\r\n+ Tìm hiểu quy mô, đối tượng khách hàng, phong cách thiết kế => chốt phong cách hiện đại. \r\n+ Suy nghĩ và đặt tên cho quán: Moon','-Công việc được giao:\r\nThiết kế quán cà phê 3D, kích thước mặt bằng 10x22m\r\n\r\n-Nội dung và kết quả đạt được:\r\n Lên ý tưởng cho quán cà phê: \r\n+ Vẽ phác thảo logo của quán\r\n+ Phác thảo sơ bố cục quán cà phê ( tường, vị trí quầy cà phê, bàn ghế,...)','-Công việc được giao:\r\nThiết kế quán cà phê 3D, kích thước mặt bằng 10x22m\r\n\r\n-Nội dung và kết quả đạt được: \r\n+ Tham khảo các mẫu quầy cà phê, bàn, ghế trên internet\r\n+ Tiếp tục vẽ phác thảo chi tiết của quầy cà phê, bàn, ghế...','-Công việc được giao:\r\nThiết kế quán cà phê 3D, kích thước mặt 